window.bookSummaryJSON = "IT BEGAN WITH SIX STONES Jack West Jr. and his loyal team are in desperate disarray: they've been separated, their mission is in tatters, and Jack was last seen plummeting down a fathomless abyss. IT FINISHES HERE. After surviving his deadly fall, Jack must now race against his many enemies to locate and set in place the remaining pieces of The Machine before the coming Armageddon. WHO ARE THE FIVE WARRIORS? As the world teeters on the brink of destruction, he will learn of the Five Warriors, the individuals who throughout history have been most intimately connected to his quest. OCEANS WILL RISE, CITIES WILL FALL. Scores will be settled, fathers will fight sons, brothers will battle brothers, and Jack and his friends will soon find out exactly what the end of the world looks like..."; 
